import React from 'react';
import styled from 'styled-components';



class TabBar extends React.Component {
  state = {
    tabs: ['1', '2', '3', '4'],
    activeTab: ''
  }

  render() {
    const rooms = this.state.rooms.map(room => {
      return(
        <div>
          {room}
        </div>
      )
    })
    return (
      <div>{rooms}</div>
    )
  }
}

export default TabBar;
